  "id_str" : "14837749071",
  "text" : "あと、ハミルトン・ケイリー定理の実計算への応用は、塾で教えてて初めて知ったので、その時は「おぉ・・・」と思った。まぁ、あれ2次元ぐらいまでしか使えない気がするので、「ハミルトン・ケイリー定理を使ってる」というにはちょっと物足りない気がするけど。",
