  "geo" : {
  },
  "id_str" : "14368848206",
  "text" : "個人的には、ある英語とか他言語の単語を、無理やり日本語（漢字）にするのは嫌いじゃない、というか、積極的にやっている。MPSを「半陰解的移動粒子法」とか。しかしそれが世間一般でやるべきことかというのは、別問題なわけです。 [lab]",
  "id" : 14368848206,
  "created_at" : "Thu May 20 15:38:42 +0000 2010",
