  "geo" : {
  },
  "id_str" : "13413582890",
  "text" : "そういや、CC-BY-SAでのみライセンスしたテキストを入れても良いなら、「じゃあおれが投稿するの全部CC-BY-SAのみね！」とか言って、あらゆる記事をGFDLで利用できないようにするとかいう荒らしが出来そうな。",
  "id" : 13413582890,
