  "text" : "自分の場合は、形式的数論（自然数論を第1階の理論として構築したもの）から考えて、その後、それに対する不完全性定理の証明＆その理論にいくら新しい公理を足しても結果は変わらない、という流れで理解した（習った）のだけど、その前提を飛ばして、後ろだけで理解する方法があるんかな・・・？",
